import React, { useState } from 'react';
import './Portfolio.css';
import stockImage from './images/projects/stock.png'; // Placeholder image

const projects = [
  {
    id: 1,
    title: "Autonomous Robot Navigation",
    image: stockImage, // Add your project images
    description: "Developed autonomous navigation algorithms for mobile robots using ROS and Python.",
    tags: ["Robotics", "ROS", "Python"],
    link: "https://github.com/yourusername/project"
  },
  {
    id: 2,
    title: "Autonomous Robot Navigation",
    image: "/images/projects/hannah_gillespie.jpg", // Add your project images
    description: "Developed autonomous navigation algorithms for mobile robots using ROS and Python.",
    tags: ["Robotics", "ROS", "Python"],
    link: "https://github.com/yourusername/project"
  },
  {
    id: 3,
    title: "Autonomous Robot Navigation",
    image: "/images/projects/hannah_gillespie.jpg", // Add your project images
    description: "Developed autonomous navigation algorithms for mobile robots using ROS and Python.",
    tags: ["Robotics", "ROS", "Python"],
    link: "https://github.com/yourusername/project"
  },
  {
    id: 4,
    title: "Autonomous Robot Navigation",
    image: "/images/projects/hannah_gillespie.jpg", // Add your project images
    description: "Developed autonomous navigation algorithms for mobile robots using ROS and Python.",
    tags: ["Robotics", "ROS", "Python"],
    link: "https://github.com/yourusername/project"
  },
  // Add more projects here
];

function ProjectModal({ project, onClose }) {
  const handleOverlayClick = (e) => {
    // Only close if clicking the overlay itself, not its children
    if (e.target.className === 'modal-overlay') {
      onClose();
    }
  };

  return (
    <div className="modal-overlay" onClick={handleOverlayClick}>
      <div className="project-modal">
        <button className="modal-close" onClick={onClose}>&times;</button>
        <h2>{project.title}</h2>
        <img src={project.image} alt={project.title} />
        <p>{project.description}</p>
        <div className="project-tags">
          {project.tags.map(tag => (
            <span key={tag} className="tag">{tag}</span>
          ))}
        </div>
        <div className="modal-button-container">
          <a 
            href={project.link} 
            target="_blank" 
            rel="noopener noreferrer"
            className="button button-link"
          >
            View Project
          </a>
        </div>
      </div>
    </div>
  );
}

function Portfolio() {
  const [selectedProject, setSelectedProject] = useState(null);

  return (
    <section className="portfolio-section">
      <h3>Portfolio</h3>
      <div className="portfolio-grid">
        {projects.map(project => (
          <div
            key={project.id}
            className="portfolio-tile"
            onClick={() => setSelectedProject(project)}
          >
            <img src={project.image} alt={project.title} />
            <div className="tile-overlay">
              <h3>{project.title}</h3>
            </div>
          </div>
        ))}
      </div>
      {selectedProject && (
        <ProjectModal
          project={selectedProject}
          onClose={() => setSelectedProject(null)}
        />
      )}
    </section>
  );
}

export default Portfolio;
